import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedin } from "@fortawesome/free-brands-svg-icons";


function About() {
    return (
        <section
            id="aboutUs"
            className="container d-flex flex-column justify-content-center align-items-center align-items-md-start w-100 h-100"
        >
            <div className="row w-100">
                <div className="col-12 col-md-6">
                    <h2 className="text-white display-1 font-weight-bold">
                        <strong>
                            Skills
                        </strong>
                    </h2>
                </div>
            </div>
            <div className='row w-100'>
                <div className='col-12 col-md-6 text-white lead flex flex-row'>
                    <FontAwesomeIcon
                        icon={faLinkedin}
                        size="4x"
                        style={{ color: "#ffffff" }}
                    />
                    <FontAwesomeIcon
                        icon={faLinkedin}
                        size="4x"
                        style={{ color: "#ffffff" }}
                    />
                    <FontAwesomeIcon
                        icon={faLinkedin}
                        size="4x"
                        style={{ color: "#ffffff" }}
                    />
                </div>
            </div>
        </section>
    );
}

export default About;
